import React from 'react'
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
//import "@fortawesome/react-fontawesome";
//import CIcon from '@coreui/icons-react'
// import {LocalHospitalIcon} from '@mui/icons-material/LocalHospital';
/*import {
  cilHome,
  cibPaypal,
  cilHospital,
  cilStar,
} from '@coreui/icons'*/
//import { CNavGroup, CNavItem, CNavTitle } from '@coreui/react'
import { CNavGroup, CNavItem, CNavTitle } from '@coreui/react'

const _nav = [
  {
    component: CNavItem,
    name: 'Dashboard',
    to: '/dashboard',

    icon:  "fa-solid fa-house",
    //icon: <LocalHospitalIcon />,

   /* badge: {
      color: 'info',
      text: 'NEW',
    },*/
  },

  {
    component: CNavGroup,
    name: 'Doctor',
    to: '/Doctor',
    //icon: <FontAwesomeIcon icon="fa-solid fa-user-doctor-hair" />,
  //  icon: <LocalHospitalIcon />,
    items: [
      {
        component: CNavItem,
        name: 'All Doctor',
        to: '/Doctor/All Doctor',
      },
      {
        component: CNavItem,
        name: 'Add Doctor',
        to: '/Doctor/Add Doctor',
      },
      {
        component: CNavItem,
        name: 'Doctor profile',
        to: '/Doctor/Doctor profile',
      },
    ],
  },
  {
    component: CNavGroup,
    name: 'Appointment',
    to: '/Appointment',
    // icon: <LocalHospitalIcon />,
    items: [
      {
        component: CNavItem,
        name: 'Doctor schedule',
        to: '/Appointment/Doctor schedule',
      },
      {
        component: CNavItem,
        name: 'Book appointment',
        to: '/Appointment/Book doctor',
      },
    ],
  },
  {
    component: CNavGroup,
    name: 'Patient',
    to: '/Patient',
    // icon: <LocalHospitalIcon />,
    items: [
      {
        component: CNavItem,
        name: 'Add patient',
        to: '/Patient/Add patient',
      },
      {
        component: CNavItem,
        name: 'All patient',
        to: '/Patient/All patient',
      },
      {
        component: CNavItem,
        name: 'Patient profile',
        to: '/Patient/Patient profile',
      },
    ],
  },

  {
    component: CNavGroup,
    name: 'Payments',
    to: '/Payments',
    // icon: <LocalHospitalIcon />,
    items: [
      {
        component: CNavItem,
        name: 'Payment',
        to: '/Payments/Payment',
      },
      {
        component: CNavItem,
        name: 'Add payment',
        to: '/Paymants/Add payment',
      },

    ],
  },




  {
    component: CNavGroup,
    name: 'Pages',
    // icon: <LocalHospitalIcon />,
    items: [
      {
        component: CNavItem,
        name: 'Login',
        to: '/login',
      },
      {
        component: CNavItem,
        name: 'Register',
        to: '/register',
      },
      {
        component: CNavItem,
        name: 'Error 404',
        to: '/404',
      },
      {
        component: CNavItem,
        name: 'Error 500',
        to: '/500',
      },
    ],
  },
]


export default _nav
